import React, { Component } from 'react';

class Conferences extends Component {
    constructor(props) {
        super(props) 

        conferences: ['SEC', 'ACC', 'PAC-12', 'Big-10', 'Big-12']
    }

    render() {
        return (
            <div>
                 <h1>Conferences</h1>
                 <div>{this.props.conferences}</div>
            </div>
        )
    }
}

export default Conferences
